function App() {
  return (

<Router>
<Navbar/>
   <Routes>
        <Route exact path="/" element={
          <Posts/>
        }>
        </Route>
        <Route exact path="/blog" element={
          <Input/>
        }>
        </Route>
    </Routes>

</Router>

  );
}

export default App;
